import React from 'react';
import { View, Text, Button } from 'react-native';
import { useNavigation } from '@react-navigation/native';
import { styles } from '../styles'; // Import the styles

function Level1() {
    const navigation = useNavigation();

    const goBackToHome = () => {
        navigation.goBack();
    };

    const { level } = route.params;

  const [code, setCode] = useState(`function myFunction() {\n  console.log('Hello, World!');\n}`);

  return (
    <View>
        <Text>This is Level 1 lool</Text>
        <Button title="Back" onPress={goBackToHome} />
        <View style={styles.container}>
      <Text style={styles.header}>Level {level}</Text>
      <TextInput
        multiline
        style={styles.codeEditor}
        value={code}
        onChangeText={(newCode) => setCode(newCode)}
      />
      <CustomButton title="Go Back" onPress={goBackToHome} />
    </View>
    </View>
  );
}

export default Level1;

